import Link from 'next/link'

const Navbar = () => (
    <div>
        <ul>
            <li><Link href="/"><a title="Home">Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
        </ul>
    <style jsx>{`
        ul {
            background: #333;
            color: #fff
        }
    `}</style>
    </div>
)

export default Navbar
